import React from "react";

function NoResult() {
  const styleNoResultDiv = {
    backgroundColor: "red",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    width: "100vw",
    height: "50vh",
  };

  return (
    <div style={styleNoResultDiv}>
      <iframe
        title="sad"
        src="https://giphy.com/embed/BEob5qwFkSJ7G"
        width="200"
        height="200"
        frameBorder="0"
        class="giphy-embed"
      ></iframe>
      <h1>No Result Found !!</h1>
    </div>
  );
}

export default NoResult;
